import React, { useState ,useEffect } from 'react';

const Quizzes = () => {
    const [classroom , setClassrooms ] = useState([null])
    const {user } = useAuth0();
    const { code } = useParams(); // Get the classroom code from the URL
    

    const fetchclassroomDetails = async ()=>{

        try{
          const response = await axios.get(`http://localhost:8000/classrooms/bycode/${code}`)
          console.log(response)
          setClassrooms(response.data.classroom)
        }
        catch(error){
      console.error('Error fetching classroom details:', error);  }
      
      }
      
      
      useEffect(() => {
        fetchclassroomDetails();
      }, [code]);


    return (
        <div>
            <div className="w-full p-4">
                <div className="bg-white p-4 rounded-lg shadow-lg">
                    <div className="mt-4">
                        <div className="mb-4">
                        <div className="flex items-center space-x-3">
                                <div className="text-orange-500">
                                    &#128196;
                                </div>
                                <div>
                                    <p className="font-bold">JavaLab-A1,A3,B2</p>
                                    <p className="text-sm text-zinc-600">SEITB (July-Dec 2022)</p>
                                    <p className="text-xs text-zinc-500">Posted Wednesday, Aug 17, 2022</p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Quizzes
